import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const FooterContainer = styled.div`
    background-color: #f7f7f7;
    height:480px;
    padding:60px 80px;

    .footerInner{
      /* background-color: #00f5; */
      width:100%;
      height:380px;
      display: flex;
      position: relative;

      .footerInfo{
        width:50%;
        height: 250px;

        h1{
          font-size:22px;
          font-weight: 900;
        }

        p{
          margin-top:8px;
          font-size:14px;
          color:#909090;

          &:first-of-type{
            color:#1a1a1a;
          }
        }

        span{
          font-size:14px;
          color:#909090;
        }

        .subInfo{
          margin-top:50px;
          display: flex;
          flex-wrap: wrap;

          li{
            font-size:14px;
            margin-bottom:10px;
            color:#909090;
          }
        }

        .footerLogo{
          margin-top:50px; 
          display: flex;
          height:50px;
          align-items: center;
          box-sizing: border-box;

          .emblem{
          display: flex;
          align-items: center;

            img{
              width:38px;
              height:38px;
              margin-right:12px;
            }

            &::after{
              content: "";
              border-right:1px solid #cccccc;
              width:1px;
              height:26px;
              margin-left:8px;
            }
          }

          .snsLogo{
            display: flex;
            margin-left:20px;

            img{
              margin-right:12px;
            }
          }
        }
      }

      .footerMenu{
        background-color: #f60;
        width:50%;

        ul{
          background-color: #0f0;
          display: flex;
          flex-wrap: wrap;
          text-align: right;
          justify-content: right;

          li{
            font-size:14px;
          }
        }
      }

      .copyRight{
        display: flex;
        justify-content: space-between;
        align-items: center;
        width:100%;
        position: absolute;
        left:0;
        bottom:0;
        border-top:1px solid #cccccc;
        padding-top:30px;

        ul{
          display: flex;
          justify-content: center;
          align-items:center;

          li{

            a{
              display: flex;
            align-items: center;
            }
            
          }
          
          img{
            width:20px;
            height:auto;

            &.arrow{
              width:10px;
              height:10px;
            }
          }
        }
      }
    }
`;

const Footer = memo(() => {
  const { footerInfo, subInfo, footerMenu } = dataset.footer;
  console.log(footerInfo);

  return (
    <FooterContainer>
      <div className='footerInner'>
        <div className='footerInfo'>
          <h1>1670-9600</h1>
          {footerInfo.map(({text}, i) =>{
            return(
              <p key={i}>{text}</p>
            );
          })}
          <ul className='subInfo'>
            {subInfo.item.map((v, i) =>{
              return(
                <li key={i}>{v.text}</li>
              );
            })}
          </ul>
          <span>{subInfo.msg}</span>
          <div className='footerLogo'>
            <ul className='emblem'>
              <li><a href='#'><img src='/img/emblem01.png' /></a></li>
              <li><a href='#'><img src='/img/emblem02.png' /></a></li>
              <li><a href='#'><img src='/img/emblem03.png' /></a></li>
            </ul>
            <ul className='snsLogo'>
              <li><a href='#'><img src='/img/sns/bt_sns_face.png' /></a></li>
              <li><a href='#'><img src='/img/sns/bt_sns_insta.png' /></a></li>
              <li><a href='#'><img src='/img/sns/bt_sns_you.png' /></a></li>
              <li><a href='#'><img src='/img/sns/bt_sns_blog.png' /></a></li>
              <li><a href='#'><img src='/img/sns/bt_sns_post.png' /></a></li>
            </ul>
          </div>
        </div>
        <div className='footerMenu'>
          <ul>
            {footerMenu.map((v, i) =>{
              return(
                <li key={i}>{v.menu}</li>
              );
            })}
          </ul>
        </div>
        <div className='copyRight'>
          <span>Copyright ⓒ 스파오닷컴 All Right Reserved.</span>
          <ul>
            <li><a href='#'><img src='/img/icon/bt_icon_lgec.png' />구매안전(에스크로)서비스</a></li>
            <li><a href='#'><img src='/img/icon/bt_icon_app01.png' /></a></li>
            <li><a href='#'><img src='/img/icon/bt_icon_app02.png' />스파오 APP 다운로드</a></li>
            <li><a href='#'><img src='/img/icon/bt_icon_global.png' />대한민국 | 한국어 <img src='/img/icon/bt_icon_global_arrow.png' className='arrow' /></a></li>
          </ul>
        </div>
      </div>
    </FooterContainer>
  );
});

export default Footer;
